import React from 'react';
import { Container, Typography, Button, AppBar, Toolbar, Grid, Box } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import useMediaQuery from '@mui/material/useMediaQuery';
import { useTheme } from '@mui/material/styles';

function LandingPage() {
  const navigate = useNavigate();
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

  return (
    <>
      <AppBar position="static" style={{ backgroundColor: '#80d8ff' }}>
        <Toolbar>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            Anaemia Predictor
          </Typography>
          <Button
            variant="contained"
            color="secondary"
            onClick={() => navigate("/signup")}
            sx={{
              background: "linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)",
              boxShadow: "0px 3px 5px 2px rgba(255, 105, 135, .3)",
              color: "white",
              "&:hover": {
                background: "linear-gradient(45deg, #FF8E53 30%, #FE6B8B 90%)",
                boxShadow: "0px 5px 10px 2px rgba(255, 105, 135, .3)",
              },
            }}
          >
            Sign Up
          </Button>
          <Button
            variant="contained"
            color="secondary"
            onClick={() => navigate("/signin")}
            sx={{
              background: "linear-gradient(45deg, #3F51B5 30%, #2196F3 90%)",
              boxShadow: "0px 3px 5px 2px rgba(63, 81, 181, .3)",
              color: "white",
              "&:hover": {
                background: "linear-gradient(45deg, #2196F3 30%, #3F51B5 90%)",
                boxShadow: "0px 5px 10px 2px rgba(63, 81, 181, .3)",
              },
              ml: 1,
            }}
          >
            Sign In
          </Button>
          <Button
  variant="contained"
  color="secondary"
  onClick={() => navigate("/about")}
  sx={{
    background: "linear-gradient(45deg, #4caf50 30%, #8bc34a 90%)",
    boxShadow: "0px 3px 5px 2px rgba(76, 175, 80, .3)",
    color: "white",
    "&:hover": {
      background: "linear-gradient(45deg, #8bc34a 30%, #4caf50 90%)",
      boxShadow: "0px 5px 10px 2px rgba(76, 175, 80, .3)",
    },
    ml: 1,
  }}
>
  About
</Button>

        </Toolbar>
      </AppBar>

      <Box
        sx={{
          backgroundImage: `url('https://source.unsplash.com/water/1600x900')`,
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          backgroundRepeat: 'no-repeat',
          filter: 'blur(2px)',
          width: '100%',
          height: '100%',
          position: 'absolute',
          zIndex: -1,
        }}
      />

      <Container
        maxWidth="lg"
        style={{
          backgroundColor: '#F5F5F5',
          padding: '100px',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          height: '100vh',
          flexDirection: isMobile ? 'column' : 'row',
        }}
      >
        <Grid container spacing={2} justifyContent="center" alignItems="center" style={{ minHeight: '80vh' }}>
          <Grid item xs={12}>
            <Typography variant="h3" align="center" gutterBottom style={{ color: '#3F51B5' }}>
              Welcome to Anaemic-Prediction
            </Typography>
          </Grid>
          <Grid item xs={12} align="center">
            <img src="https://miro.medium.com/v2/resize:fit:1400/1*Z-Aqguy-l1cve-gDupTG7A.jpeg" alt="Anaemia Prediction" style={{ width: '100%', maxWidth: '500px', height: 'auto' }} />
          </Grid>
          <Grid item xs={12}>
            <Typography variant="h6" align="center" paragraph style={{ color: '#3F51B5' }}>
              This is a website where you can upload your image and we will predict whether you have anemia or not. Our machine learning model is trained to detect anemia from images.
            </Typography>
          </Grid>
          <Grid item xs={12}>
            <Typography variant="body1" align="center" paragraph>
              Anemia is a condition in which you lack enough healthy red blood cells to carry adequate oxygen to your body's tissues. Having anemia can make you feel tired and weak. There are many forms of anemia, each with its own cause. Anemia can be temporary or long term, and it can range from mild to severe.
            </Typography>
          </Grid>
          <Grid item xs={12}>
            <Typography variant="body1" align="center" paragraph>
              Our model is designed to detect anemia by analyzing the color of the inner eyelid. This method is non-invasive and can be done easily at home. Please make sure to upload a clear and well-lit image for accurate results.
            </Typography>
          </Grid>
          <Grid item xs={12} align="center">
            <Button
              variant="contained"
              color="primary"
              onClick={() => navigate("/signin")}
              sx={{
                background: "linear-gradient(45deg, #2196F3 30%, #64B5F6 90%)",
                boxShadow: "0px 3px 5px 2px rgba(33, 150, 243, .3)",
                color: "white",
                "&:hover": {
                  background: "linear-gradient(45deg, #64B5F6 30%, #2196F3 90%)",
                  boxShadow: "0px 5px 10px 2px rgba(33, 150, 243, .3)",
                },
              }}
            >
              Try it Now
            </Button>
          </Grid>
        </Grid>
      </Container>
    </>
  );
}

export default LandingPage;
